function SidebarRow({Src, title, PersonName}) {
    return (
        <div>
             <p className= "hidden sm:inline-flex font-medium">
               Ranking</p> 
        <div className="flex items-center space-x-2 mb-6 p-4 text-gray-500 hover:bg-gray-200 rounded-full cursor-pointer">
            {Src && <img src= {Src} alt="dp" className= "hidden sm:inline-flex w-10 h-10 p-1 bg-white object-cover rounded-full "/>}
           <p className= "hidden sm:inline-flex font-medium">
               {title}</p>
            <p className= "hidden sm:inline-flex font-medium">
               {PersonName}</p> 
        </div>
        </div>

    )
}

export default SidebarRow;
